import '../css/Card.css';
import React from 'react';
import {Link} from 'react-router-dom';

function Card(props) {
  return (   
    <Link class="card-container" 
    to="/details/Mandolin"
      state={props}
    >
        <div>
            <img src="../assets/us.jpg" alt="Mandolin" />
            <h1>{props.name}</h1>
            <p>Mandolin that is lightly used, solid construction.</p>
            <span>Price: $40</span>
        </div>
    </Link>
  );
}

export default Card;
